function getRepos(e){$("main .card").remove(),$("main p").remove(),$('<p class="has-text-primary" style="text-align: center;font-weight: 600">LOADING ...</p>').appendTo($("main")),""!==e?$.ajax("https://api.github.com/search/repositories?q="+e,{success:function(e){$("main p").remove(),e.total_count>0?e.items.forEach(function(e){$(repolist(e)).appendTo($("main"))}):$('<p class="has-text-warning" style="text-align: center;font-weight: 600">No result.</p>').appendTo($("main"))}}):($("main p").remove(),$('<p class="has-text-danger" style="text-align: center;font-weight: 600">Enter search query.</p>').appendTo($("main")))}var repolist=Handlebars.compile($("#template").html());$(document).ready(function(){$("#search").keypress(function(e){13==e.which&&getRepos($("#search").val())})});